import React from 'react';
import axios from 'axios';
import styles from './Drinks.module.css'
import { useDispatch, useSelector } from 'react-redux';
import { setDrinksCards } from '../../../Redux/slices/DrinksCardSlice'

function DrinksCard({ img, name, desc, price }) {
  const dispatch = useDispatch()
  const Drinks = useSelector((state) => state.DrinksCard.DrinksCards)

  React.useEffect(() => {
    axios
      .get(' http://demo5518646.mockable.io/DrinksCard')
      .then((res) => {
        dispatch(setDrinksCards(res.data));
      });

  }, [dispatch, Drinks]);

 


  return (
    <div>
      <h1 className={styles.MenuDrinks}>Все Напитки</h1>
      <div className={styles.inline}>
        asdasdada
        {Drinks.map(card => <h1>{card.name}</h1>)}
      </div>
    </div>
  )
}

export default DrinksCard
